import React from "react";

function CreateUsers() {
  const user = {
    name: "Andrius",
    age: 29,
    city: "Trakai",
  };
  const options = {
    method: "POST",
    headers: {
      "content-type": "<application/ json",
    },
    body: JSON.stringify(user),
  };

  function send() {
    fetch("http://localhost:4000/addUser ", options)
      .then((res) => res.json())
      .then((data) => {});
  }
  return (
    <div>
      <h1>createUsers</h1>
      <button onClick={send}>Send</button>
    </div>
  );
}

export default CreateUsers;
